import React from 'react';
import { Link } from "react-router-dom";

function Dashboard(props){
    return (
        <div>
            <center>
            <Link to="/todo">
                <input type="submit" value="Contacts" />
            </Link>

            <Link to="/todo">
                <input type="submit" value="Todos" />
            </Link>
            </center>
            <hr />
        </div>
    )
}

export default Dashboard;
